import React from "react"
import Header from "../components/Header"
import mainImage from "../assets/man-on-rocket.svg"
import logo from "../assets/job-cache-logo-nobg.png"

export default function Home() {

    const containerStyling = {
        padding:"1em",
        display:"flex",
        justifyContent:"center",
        flexDirection:"column",
        alignItems:"center"
    }
    const imageStyling = {
        width:"200px"
    }

    return (
        <div className="home-page" style={containerStyling}>
            <Header 
                icon={logo}
                secondButtontext={"LOGIN"}
                thirdButtontext={"SIGN UP"}  
            />
            <h1>JobCache</h1>
            <h2>Effortless Organization for Your Job Applications.</h2>
            <img 
                src={mainImage} 
                alt="man holds a briefcase while standing on rocket as it flys into the sky" 
                className="main-image"
                style={imageStyling}
            />
        </div>
    )
}
